import EditableTable from '../components/table/EditableTable';

function JobLocation(props) {
  return (
    <>
      <EditableTable
        showSearch="none"
        showIcon="none"
        JobLink="Job Locations"
        jobTitleT="Job Title"
        jobTitle="title"
        jobLocationT="Job Location"
        jobLocation="location"
        location1="New York"
        location2="London"
        startDateT="Start Date"
        startDate="Sdate"
        endDateT="End Date"
        endDate="Edate"
        statusT="Status"
        statuss="status"
        onChangeS={props.onChangeS}
        result={props.result}
      />
    </>
  );
}

export default JobLocation;
